function eventClick(event, jsEvent, view) {
    jsEvent.preventDefault();
	
	var eventDate;
	if (event.allDay) {
		eventDate = '<b>When:</b> ' + $.fullCalendar.formatDate(event.start, dateFormat, dateNames);
	}else{
		eventDate = '<b>Start:</b> ' + $.fullCalendar.formatDate(event.start, dateFormat + ' ' + timeFormat, dateNames) + '<br /><b>End:</b> ' + $.fullCalendar.formatDate(event.end, dateFormat + ' ' + timeFormat, dateNames);
	}
		
		
	if ( $(jsEvent.currentTarget).is('.event-google') ) {
	 	var gcontent = '<div class="yddl-event"><div class="yddl-event-details"><div class="detailed-event-header"><span class="event-title">' + event.title + '</span><br /> ' + eventDate + ' </div><div class="detailed-event-body">' + event.description + '</div></div></div>';
	    showDialog(event.title, gcontent);
		return;
	}
	
    var url = eventUrl;
    var body = $(document.body), h = body.height(), top = $(window).scrollTop(); 
    
    // display overlay and spinner while fetching event details
    $('<div id="yddl-overlay1" class="yddl-overlay ui-widget-overlay"></div>').height(h).appendTo(body);
    $('<div id="yddl-overlay2" class="yddl-overlay ui-widget-overlay"></div>').css('top',top).appendTo(body);

    // fetch details
    $.ajax({
        url: url,
        data: { id: event.id },
        dataType: 'json',
        complete: onComplete,
        success: onSuccess,
        error: onError,
        timeout: defaultTimeout
    });
    
    function onComplete() {
        // remove overlay
        $('div.yddl-overlay').remove();
    }
    function onSuccess(data) {
		var eventContent = '<div class="yddl-event"><div class="yddl-event-details"><div class="detailed-event-header"><span class="event-title">' + event.title + '</span><br /> ' + eventDate + ' </div><div class="detailed-event-body">' + data.details + '</div></div></div>';
	    showDialog(event.title, eventContent)
        //showDialog(data.title, eventTemplate.replace(/{details}/, data.details));
    }
    function onError(xhr, status) {
        showDialog('Error', eventTemplate.replace(/{details}/, errorMessage + status + '</em></p>'));
    }
    function showDialog(title, content) {
        // display content in dialog
        var dialog = $('<div class="yddl-event">'+content+'</div>').appendTo(document.body).dialog({
            //title: title,
            modal: true,
            width: defaultEventDetailWidth,
			dialogClass: 'yddl-dialog',
            close: close
        });
    
        function close() {
            dialog.dialog('destroy').remove();
        }
    }
}

